export const Content = () => {
  return (
    <div className="mt-10 w-[960px]">
      <div className="w-[250px] float-left border border-solid border-black">
        <div className="ml-2 my-4">
          <span className="text-xl font-bold my-3">현재 선택된 게시물</span>
          <div className="flex flex-col">
            <span>Title:</span>
            <span>Description:</span>
            <span>Writer:</span>
          </div>
        </div>
      </div>
      <div className="w-[700px] float-right border border-solid border-black">
        <span>게시물 목록</span>
      </div>
    </div>
  );
};
